    <script>
    function init() {
    var body = document.body, html = document.documentElement;
    var height = Math.max( body.scrollHeight, body.offsetHeight,html.clientHeight, html.scrollHeight, html.offsetHeight );
    document.getElementById("content_frame").style.height = String(height * 0.9) +"px";
    }

    function markSelected(obj) {
        var x = document.getElementById("framecontent");
        var y = x.getElementsByTagName("a");
        var i;
        for (i = 0; i < y.length; i++) {
            y[i].className = "";
        }
        obj.className = "setSelected";
    }

    function markSelectedInitial() {
        var x = document.getElementById("framecontent");
        x.getElementsByTagName("a")[0].className = "setSelected";
        document.getElementById("content_frame").contentWindow.document.location.href = x.getElementsByTagName("a")[0].href;
    }

    </script>
